query GetImagesOverview(
  $accountId: string
  $dateFrom: string
  $dateTo: string
) {
  viewer {
    accounts(filter: { accountTag: $accountId }) {
      imagesRequestsAdaptiveGroups(
        limit: 10000
        filter: { datetime_geq: $dateFrom, datetime_leq: $dateTo }
      ) {
        sum {
          requests
        }
      }
      imagesUniqueTransformations(
        limit: 30
        filter: { date_geq: $dateFromShort, date_leq: $dateToShort }
        orderBy: [date_DESC]
      ) {
        date
        transformations
      }
    }
  }
}

query GetStartOfMonthTransformationsAnalytics(
  $accountId: string
  $dateFrom: string
  $dateTo: string
) {
  viewer {
    accounts(filter: { accountTag: $accountId }) {
      imagesUniqueTransformationsAccumulatedSinceStartOfMonth(
        limit: 60
        filter: { date_geq: $dateFromShort, date_leq: $dateToShort }
        orderBy: [date_ASC]
      ) {
        date
        transformations
      }
      mediaUniqueTransformationsAccumulatedSinceStartOfMonth(
        limit: 60
        filter: { date_geq: $dateFromShort, date_leq: $dateToShort }
        orderBy: [date_ASC]
      ) {
        date
        transformations
      }
    }
  }
}
